import React from "react";

function form(props) {
  const onSubmit = (event) => {
    alert("value submitted");
	event.preventDefault();
  };

  return (
    <div>
      <form>
        <label>
          Name:
          <input type="text" name="name" />
        </label>
        <button
          onClick={onSubmit}
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default form;
